function _dir(){
	$sql="SHOW VARIABLES LIKE '%plugin_dir%'";
	$row=mysql_query($sql);
	$rows=mysql_fetch_row($row);
	return  $rows[1];


}


function _ver(){
	$_version=array();
	$sql="show variables like '%version%'";
	$row=mysql_query($sql);
	while($rows=mysql_fetch_row($row)){
	
	$_version += array($rows[0]=>$rows[1]);
	
	
	}
	return $_version;
	

}























